import { useState } from "react"

const Image = () => {
    const [img, setImg] = useState()
    return(
        <>
        <div>
            <input type="text" placeholder="img url" onInput={(event) => setImg(event.target.value)}/>
            <img src={img} alt="" />
        </div>
            
        </>
    )
}

export default Image;
